import React, { useEffect, useState } from "react";
import "./prescription.css";
import axios from "axios";

const Prescription = ({ prescriptionId }) => {
  const [prescription, setPrescription] = useState(null);

  useEffect(() => {
    axios
      .get(`/api/prescriptions/${prescriptionId}`)
      .then((response) => setPrescription(response.data))
      .catch((error) => console.error("Error fetching prescription:", error));
  }, [prescriptionId]);

  if (!prescription) {
    return <p>Loading prescription...</p>;
  }

  return (
    <div className="container">
      <div className="prescription-card">
        {/* Header */}
        <div className="header">
          <h2>PRESCRIPTION</h2>
        </div>
        
        {/* Doctor Info */}
        <div className="doctor-info">
          <h3>Dr. {prescription.doctorId.name}</h3>
          <p className="specialty">{prescription.doctorId.specialty || "Doctor"}</p>
        </div>
        
        {/* Patient Info */}
        <div className="patient-info">
          <div className="info-field">
            <p>Patient Name:</p>
            <p className="underline">{prescription.patientId.name}</p>
          </div>
          <div className="info-field">
            <p>Address:</p>
            <p className="underline">{prescription.patientId.address}</p>
          </div>
          <div className="info-field">
            <p>Date:</p>
            <p className="underline">{new Date(prescription.dateIssued).toLocaleDateString()}</p>
          </div>
          <div className="info-field">
            <p>Insurance:</p>
            <p className="underline">{prescription.patientId.insurance}</p>
          </div>
          <div className="info-field">
            <p>Diagnosis:</p>
            <p className="underline">{prescription.diagnosis}</p>
          </div>
        </div>

        {/* Prescription */}
        <div className="prescription-section">
          <p className="rx">Rx</p>
          <div className="prescription-box">
            {prescription.medicines.map((med, index) => (
              <div key={index} className="medicine">
                <p><strong>{med.medicineName}</strong> - {med.dosage}, {med.frequency}</p>
                <p>Quantity: {med.quantity}</p>
                <p>Instructions: {med.instructions}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Notes */}
        <div className="notes-section">
          <p><strong>Notes:</strong> {prescription.notes}</p>
        </div>

        {/* Signature */}
        <div className="signature-section">
          <p>Signature</p>
          <p className="underline signature-line"></p>
        </div>

        {/* Footer */}
        <div className="footer">
          <p>📞 + (00) 123 456 789 | ✉ company@mail.com</p>
          <p>🌐 www.companyname.com | 📍 your company address</p>
        </div>
      </div>
    </div>
  );
};

export default Prescription;
